import {Axios} from "@/services/axios.js"

export default{
    async RegisterUser(data){
        try {
            const resp= await Axios.post('users',data)
        } catch (error) {
            return false
        }
    },
    async LoginUser(data){
        try {
            const resp = await Axios.post('auth/login',data)
        } catch (error) {
            return false
        }
    }
}
